    static class Solution {
        public int minimumObstacles(int[][] grid) {
            int height = grid.length;
            int width = grid[0].length;
            int[][] dirs = new int[][]{{1, 0}, {0, 1}, {-1, 0}, {0, -1}};
            boolean[][] visited = new boolean[height][width];
            // BFS + 优先队列
            PriorityQueue<int[]> queue = new PriorityQueue<>(Comparator.comparingInt(o -> o[2]));
            queue.add(new int[]{0, 0, 0});
            while (!queue.isEmpty()) {
                int[] pos = queue.poll();
                int currentY = pos[0];
                int currentX = pos[1];
                int currentCnt = pos[2];
                visited[currentY][currentX] = true;
                if (currentY == height - 1 && currentX == width - 1) {
                    return currentCnt;
                }
                for (int[] dir : dirs) {
                    int nextY = currentY + dir[0];
                    int nextX = currentX + dir[1];
                    if (nextX < 0 || nextX >= width || nextY < 0 || nextY >= height || visited[nextY][nextX]) {
                        continue;
                    }
                    int nextStatus = currentCnt + grid[nextY][nextX];
                    int[] nextPos = new int[]{nextY, nextX, nextStatus};
                    queue.add(nextPos);
                }
            }
            return -1;
        }
    }

    static class Solution_DFS {
        int[][] dirs = new int[][]{{1, 0}, {0, 1}, {-1, 0}, {0, -1}};
        boolean[][] visited;
        int height;
        int width;
        int res;
        int[][] memo;

        public int minimumObstacles(int[][] grid) {
            height = grid.length;
            width = grid[0].length;
            visited = new boolean[height][width];
            memo = new int[height][width];
            res = height + width;
            dfs(grid, 0, 0, 0);
            return res;
        }

        private void dfs(int[][] grid, int y, int x, int dragCnt) {
            if (dragCnt > res) {
                return;
            }
            if (y == height - 1 && x == width - 1) {
                res = Math.min(res, dragCnt);
                return;
            }
            visited[y][x] = true;
            int currentDragCnt = dragCnt + grid[y][x];
            memo[y][x] = currentDragCnt;
            for (int[] dir : dirs) {
                int nextY = y + dir[0];
                int nextX = x + dir[1];
                if (nextY < 0 || nextX < 0 || nextY >= height || nextX >= width) {
                    continue;
                }
                if (!visited[nextY][nextX] && (memo[nextY][nextX] == 0 || memo[nextY][nextX] > currentDragCnt + grid[nextY][nextX])) {
                    dfs(grid, nextY, nextX, currentDragCnt);
                }
            }
            visited[y][x] = false;
        }
    }

